import './Recommendations.css';

import React from "react";

import agraImg from "./assets/agraImg.png";
import jaipurImg from "./assets/jaipurImg.png";
import kolkataImg from "./assets/kolkataImg.png";
import amritsarImg from "./assets/amritsarImg.png";

function Recommendations(){
    return(
        <>
        <div id="title">
            Popular places you can visit
        </div>

        <div id="cardsWrapper">
            <div id="cards">
                <div class="card" id="card1">
                    <img src={agraImg} class="cardImg" id="cardImg1"></img> 
                </div>
                <div class="card" id="card2">
                    <img src={jaipurImg} class="cardImg" id="cardImg2"></img> 
                </div>
                <div class="card" id="card3">
                    <img src={kolkataImg} class="cardImg" id="cardImg3"></img> 
                </div>
                <div class="card" id="card4">
                    <img src={amritsarImg} class="cardImg" id="cardImg4"></img> 
                </div>
            </div>
        </div>
        </>
    );
}


export default Recommendations;
